import React from 'react';
import '../styles/header/header.css';
import { WhatsAppOutlined } from '@ant-design/icons';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import Box from '@mui/joy/Box';
import IconButton from '@mui/joy/IconButton';
import Drawer from '@mui/joy/Drawer';
import List from '@mui/joy/List';
import ListItemButton from '@mui/joy/ListItemButton';
import Typography from '@mui/joy/Typography';
import ModalClose from '@mui/joy/ModalClose';
import Menu from '@mui/icons-material/Menu';

export default function Header() {
  const [open, setOpen] = React.useState(false);

  return (
    <React.Fragment>
      {/* Верхний код для десктопа */}
      <div className='header desktop-header'>
        <div className='header__nav_logo' />
        <nav className='header__nav'>
          <ul className='header__nav_ul'>
            <li className='header__nav_li'>
              <a href='#' className='header__nav_li_select'>
                КАТАЛОГ
              </a>
              <ul className='sub-menu'>
                <li className='sub-menu_li'>Литые елки</li>
                <li className='sub-menu_li'>Уличные елки</li>
                <li className='sub-menu_li'>Заснеженные елки</li>
                <li className='sub-menu_li'>Елки с лампочками</li>
                <li className='sub-menu_li'>Комбинированные елки</li>
              </ul>
            </li>
            <li className='header__nav_li'>
              <a href='#'>КОНТАКТЫ</a>
            </li>
            <li className='header__nav_li'>
              <a href='#'>ДОСТАВКА И ОПЛАТА</a>
            </li>
          </ul>
          <h3 className='header__nav_num'>
            <WhatsAppOutlined
              className='header__nav_svg'
              style={{ fontSize: 25 }}
            />
            +7-963-323-54-23
          </h3>
          <img className='header__nav_cop' />
          <ShoppingCartIcon
            className='header__nav_shop'
            style={{ fontSize: 30 }}
          />
        </nav>
      </div>

      // Monile
      <div className='header mobile-header'>
        <IconButton variant="outlined" color="neutral" onClick={() => setOpen(true)}>
          <Menu />
        </IconButton>
        <Drawer open={open} onClose={() => setOpen(false)}>
          <Box
            sx={{
              display: 'flex',
              alignItems: 'center',
              gap: 0.5,
              ml: 'auto',
              mt: 1,
              mr: 1,
            }}
          >
            <Typography
              component="label"
              htmlFor="close-icon"
              fontSize="sm"
              fontWeight="lg"
              sx={{ cursor: 'pointer' }}
            >
              Закрыть
            </Typography>
            <ModalClose id="close-icon" sx={{ position: 'initial' }} />
          </Box>
          <List
            size="lg"
            component="nav"
            sx={{
              flex: 'none',
              mt: 6,
              mb: 5,
              fontSize: 'xl',
              '& > div': { justifyContent: 'center' },
            }}
          >
            <ListItemButton >КАТАЛОГ</ListItemButton>
            <ListItemButton>КОНТАКТЫ</ListItemButton>
            <ListItemButton>ДОСТАВКА И ОПЛАТА</ListItemButton>
            <Box display={'flex'} flexDirection={'row'} marginTop={'30px'}>
            <WhatsAppOutlined
              className='header__nav_svg'
              style={{ fontSize: 25 }}
            />
            <Typography>+7-923-4213-32-23</Typography>
            </Box>

          </List>
          <Box sx={{ px: 5, textAlign: 'center' }}></Box>
        </Drawer>
      </div>
    </React.Fragment>
  );
}
